import React, { Component } from 'react'
import './App.css'
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import axios from 'axios'

class Get extends React.Component {
  constructor() {
    super()
    this.state = {
      user: []
    }

    this.handleClick = this.handleClick.bind(this);
  }

  handleClick() {
    axios.get('http://localhost:8888/student').then(response => {
      this.setState({
        user: response.data
      })
    })
  }

  render() {
    return (
      <div className='button__container'>
        <button className='button' onClick={this.handleClick}>Click Me</button>
        {this.state.user.map(users =>
          <div className='container disable' style={text_center}>
            <table className='table' style={width1}>
              <tr>
                <th>ID</th>
                <th>Name</th>
                <th>Age</th>
              </tr>
              <tr>
                <td key={users.id}>{users.id}</td>
                <td key={users.id}>{users.name}</td>
                <td key={users.id}>{users.age}</td>
              </tr>
            </table>
          </div>
        )}


      </div>
    )
  }
}
const width = {
  width: '100px',
  marginLeft: '10px',
}
const width1 = {
  marginLeft: '10%', width: '80%', textAlign: 'center'
}
const text_center = {
  textAlign: 'center'
}
const margin = {
  margin: '2% 0'
}

export default Game;
